  'INSERT INTO `vs_dramas_video` VALUES (null, __SITEID__, 1, \'__CATEGORY__\', __AREA__, __YEAR__, \'试婚之热恋99天\', \'《试婚之热恋99天》：该网络短剧讲述了一对年轻情侣决定通过试婚来测试彼此的关系。他们约定在99天内模拟婚姻生活，共同面对各种挑战和磨难。在这个过程中，两人经历了爱情的考验和成长，最终真正领悟到了婚姻的意义，并决定真正步入婚姻的殿堂。\', \'http://222.186.43.171:99/v/77-试婚之热恋99天/logo.png\', \'hot,recommend\', \'《试婚之热恋99天》：该网络短剧讲述了一对年轻情侣决定通过试婚来测试彼此的关系。他们约定在99天内模拟婚姻生活，共同面对各种挑战和磨难。在这个过程中，两人经历了爱情的考验和成长，最终真正领悟到了婚姻的意义，并决定真正步入婚姻的殿堂。\', \'名著\', \'图文详情暂时无用\', 180, 150, 72, \'8.5\', 0, 0, 2, 0, 0, 0, 0, 0, 0, 160, \'up\', 1691474759, 1691474759, null);' => 
