  'INSERT INTO `vs_dramas_video` VALUES (null, __SITEID__, 1, \'__CATEGORY__\', __AREA__, __YEAR__, \'都市之系统\', \'《都市之系统》：该网络短剧讲述了一位平凡的都市青年突然获得了一款智能系统，从而拥有了超凡的能力和智慧。在这个都市中，他利用系统的帮助，解决了各种问题和困难，同时也经历了成长和改变。通过与周围人的互动，他逐渐发现了自己人生的真正意义。\', \'http://222.186.43.171:99/v/8-都市之系统/logo.png\', \'hot,recommend\', \'《都市之系统》：该网络短剧讲述了一位平凡的都市青年突然获得了一款智能系统，从而拥有了超凡的能力和智慧。在这个都市中，他利用系统的帮助，解决了各种问题和困难，同时也经历了成长和改变。通过与周围人的互动，他逐渐发现了自己人生的真正意义。\', \'名著\', \'图文详情暂时无用\', 180, 150, 61, \'8.5\', 0, 0, 2, 0, 0, 0, 0, 0, 0, 163, \'up\', 1691475142, 1691475142, null);' => 
