  'INSERT INTO `vs_dramas_video` VALUES (null, __SITEID__, 1, \'__CATEGORY__\', __AREA__, __YEAR__, \'桃运无双\', \'《桃运无双》：该网络短剧以喜剧为主题，讲述了一个平凡无奇的青年突然得到了运气神秘加持的故事。在这个过程中，他遇到了各种幸运的事情和意外的收获，并逐渐展示出别具一格的个人魅力和激情。通过他的努力和乐观向上的精神，他最终实现了自己的人生目标。\', \'http://222.186.43.171:99/v/80-桃运无双/logo.png\', \'hot,recommend\', \'《桃运无双》：该网络短剧以喜剧为主题，讲述了一个平凡无奇的青年突然得到了运气神秘加持的故事。在这个过程中，他遇到了各种幸运的事情和意外的收获，并逐渐展示出别具一格的个人魅力和激情。通过他的努力和乐观向上的精神，他最终实现了自己的人生目标。\', \'名著\', \'图文详情暂时无用\', 180, 150, 106, \'8.5\', 0, 0, 1, 0, 0, 0, 0, 0, 0, 164, \'up\', 1691475249, 1691475249, null);' => 
