  'INSERT INTO `vs_dramas_video` VALUES (null, __SITEID__, 1, \'__CATEGORY__\', __AREA__, __YEAR__, \'天龙枭婿\', \'《天龙枭婿》：该网络短剧以武侠为背景，讲述了一位年轻男子被选定成为一位武功高强的龙门掌门的婿子。在这个世界里，男主角必须面对武林中的各种挑战和危险，同时也揭示了隐藏在背后的阴谋和秘密。通过修炼和努力，男主角最终成为了一位真正的武林英雄，守护着正义和道义。\', \'http://222.186.43.171:99/v/83-天龙枭婿/logo.png\', \'hot,recommend\', \'《天龙枭婿》：该网络短剧以武侠为背景，讲述了一位年轻男子被选定成为一位武功高强的龙门掌门的婿子。在这个世界里，男主角必须面对武林中的各种挑战和危险，同时也揭示了隐藏在背后的阴谋和秘密。通过修炼和努力，男主角最终成为了一位真正的武林英雄，守护着正义和道义。\', \'名著\', \'图文详情暂时无用\', 180, 150, 39, \'8.5\', 0, 0, 1, 0, 0, 0, 0, 0, 0, 167, \'up\', 1691475846, 1691475846, null);' => 
