  'INSERT INTO `vs_dramas_video` VALUES (null, __SITEID__, 1, \'__CATEGORY__\', __AREA__, __YEAR__, \'天王殿\', \'《天王殿》：该网络短剧讲述了一位年轻音乐人追逐音乐梦想的故事。在追求音乐的道路上，他面临着各种困难和挑战，同时也结识了一群志同道合的音乐人。通过共同努力和奋斗，他们最终在音乐界取得了巨大的成功，并成为了备受瞩目的天王级明星。\', \'http://222.186.43.171:99/v/84-天王殿/logo.png\', \'hot,recommend\', \'《天王殿》：该网络短剧讲述了一位年轻音乐人追逐音乐梦想的故事。在追求音乐的道路上，他面临着各种困难和挑战，同时也结识了一群志同道合的音乐人。通过共同努力和奋斗，他们最终在音乐界取得了巨大的成功，并成为了备受瞩目的天王级明星。\', \'名著\', \'图文详情暂时无用\', 180, 150, 68, \'8.5\', 0, 0, 1, 0, 0, 0, 0, 0, 0, 168, \'up\', 1691475998, 1691475998, null);' => 
