  'INSERT INTO `vs_dramas_video` VALUES (null, __SITEID__, 1, \'__CATEGORY__\', __AREA__, __YEAR__, \'我的快递员老公\', \'《我的快递员老公》：该网络短剧讲述了一对年轻夫妻中，丈夫是一名平凡的快递员的故事。在丈夫的工作中，他面对各种困难和艰辛，同时也承受着社会的压力和舆论的质疑。然而，妻子通过对丈夫的理解和支持，帮助他挺过了困境，最终他们共同创造了美好的未来。\', \'http://222.186.43.171:99/v/89-我的快递员老公/logo.png\', \'hot,recommend\', \'《我的快递员老公》：该网络短剧讲述了一对年轻夫妻中，丈夫是一名平凡的快递员的故事。在丈夫的工作中，他面对各种困难和艰辛，同时也承受着社会的压力和舆论的质疑。然而，妻子通过对丈夫的理解和支持，帮助他挺过了困境，最终他们共同创造了美好的未来。\', \'名著\', \'图文详情暂时无用\', 180, 150, 64, \'8.5\', 0, 0, 0, 0, 0, 0, 0, 0, 0, 172, \'up\', 1691476706, 1691476706, null);' => 
