  'INSERT INTO `vs_dramas_video` VALUES (null, __SITEID__, 1, \'__CATEGORY__\', __AREA__, __YEAR__, \'乡村小皇帝\', \'《乡村小皇帝》：这是一部喜剧网络短剧，以乡村为背景，讲述了一个天真活泼的乡村少年因为偶然的机会获得了一项特殊能力，从而引发了一系列令人捧腹大笑的故事。他利用自己的能力解决了村子里的问题，最终成为乡村的小皇帝。\', \'http://222.186.43.171:99/v/98-乡村小皇帝/logo.png\', \'hot,recommend\', \'《乡村小皇帝》：这是一部喜剧网络短剧，以乡村为背景，讲述了一个天真活泼的乡村少年因为偶然的机会获得了一项特殊能力，从而引发了一系列令人捧腹大笑的故事。他利用自己的能力解决了村子里的问题，最终成为乡村的小皇帝。\', \'名著\', \'图文详情暂时无用\', 180, 150, 83, \'8.5\', 0, 0, 2, 0, 0, 0, 0, 0, 0, 180, \'up\', 1691477954, 1691477954, null);' => 
