  'INSERT INTO `vs_dramas_video` VALUES (null, __SITEID__, 1, \'__CATEGORY__\', __AREA__, __YEAR__, \'乡村小医仙\', \'《乡村小医仙》：这是一部励志网络短剧，描述了一个家境贫困的乡村少年，因为对医学的热爱和努力，最终成为了一名出色的乡村医生的故事。他面对各种疾病和困难，通过自己的智慧和毅力，不断克服挑战，治愈了许多病患，被誉为乡村小医仙。\', \'http://222.186.43.171:99/v/99-乡村小医仙/logo.png\', \'hot,recommend\', \'《乡村小医仙》：这是一部励志网络短剧，描述了一个家境贫困的乡村少年，因为对医学的热爱和努力，最终成为了一名出色的乡村医生的故事。他面对各种疾病和困难，通过自己的智慧和毅力，不断克服挑战，治愈了许多病患，被誉为乡村小医仙。\', \'名著\', \'图文详情暂时无用\', 180, 150, 70, \'8.5\', 0, 0, 1, 0, 0, 0, 0, 0, 0, 181, \'up\', 1691478653, 1691478653, null);' => 
